&quot;However, it was not until October 23rd, 1832, that Governor Sir Richard Bourke...opened the Pass of Victoria -&quot;the crowning glory of my road&quot;, as Mitchell called it. At the present time a monument on Mount Victoria commemorates the opening of this Gateway to the West - A constant reminder of the work of a great nation builder, Major [afterwards Colonel Sir] Thomas Livingstone Mitchell.&quot; 

Source: &quot;Hartley and it's Historic Court-House&quot;

